import styled from 'styled-components';
import { BrowserRouter as Link } from 'react-router-dom';
import {FaBars} from 'react-icons/fa';

export const Nav = styled.header`
    background: #000;
`;

export const NavLink = styled(Link)`
    background: #ff0000;
`;
